window.bookSummaryJSON = "<p>The magic flames are raging. Blades are melting. Souls are reduced to ashes in the fury of battle. The grand finale of the war for the First Temple is upon us. The last trump cards have been played, the reserves are all exhausted, and even the gods have engaged in the plebeian fight. </p> <p>The universe is on the point of collapse. Broken are the chains that hold the worlds together. The icy waters of the Baltic cool the scorching sands of the Frontier. The creatures of AlterWorld spill the first blood on the quiet streets of Earth's cities. </p> <p>What will Max do? Become embittered and butcher his enemies? Seize the deserted castles and abandoned lands? Attempt to save the one who had given her life defending him? Or try to win the jackpot by finding a way home, back to Earth? </p>"; 
